import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Payment() {
  return (
    <>
      <HeroSection />
      <h11>Payment</h11>
      <p>   </p>
      <p1>Question 1</p1>
      <Footer />
    </>
  );
}

export default Payment;
